$colDataset = 0;
$colTopicCode = 1;
$colTopicName = 2;
$colDimRank = 3;
$colDimName = 4;
$colVarPattern = 5;
$colVarCode = 6;
$colUnits = 7;

$datasets = [];
/* resulting structure after processing $rawVars
["ELEC"=>[
        "HEAT_CONTENT"=>[
            "theme"=>"Quality of Fossil Fuels : Heat Content",
            "units"=>"Btu per physical units",
            "dimensions"=>[
                ["dimension"=>"Sector","rank"=>1, "list"=>[]],
                []
            ]
    ],
...
]
*/
foreach($rawVars as &$rawVar){
    //process dataset
    if(!isset($datasets[$rawVar[$colDataset]])) $datasets[$rawVar[$colDataset]] = [];
    $ds =& $datasets[$rawVar[$colDataset]];
    //process theme
    if(!isset($ds[$rawVar[$colTopicCode]])) $ds[$rawVar[$colTopicCode]] = ["theme"=>$rawVar[$colTopicName], "dimensions"=>[], "units"=>isset($rawVar[$colUnits])?$rawVar[$colUnits]:""];
    $dims =& $ds[$rawVar[$colTopicCode]]["dimensions"];

    //process dimension
    if(!isset($dims[intval($rawVar[$colDimRank])])) $dims[intval($rawVar[$colDimRank])] = ["dimension"=>$rawVar[$colDimName], "rank"=>$rawVar[$colDimRank],"totalCode"=>"", "list"=>[]];
    //$dim = $datasets[$rawVar[$colDataset]][$rawVar[$colTopicCode]]["dimensions"][$rawVar[$colDimRank]];
    //process variable
    if(isset($totals[$rawVar[$colVarPattern]])) {
        if($totals[$rawVar[$colVarPattern]]=="total") $datasets[$rawVar[$colDataset]][$rawVar[$colTopicCode]]["dimensions"][$rawVar[$colDimRank]]["totalCode"] = $rawVar[$colVarCode];
    } else {
        array_push($datasets[$rawVar[$colDataset]][$rawVar[$colTopicCode]]["dimensions"][$rawVar[$colDimRank]]["list"], array("name"=>$rawVar[$colVarPattern], "code"=>$rawVar[$colVarCode]));
    }
}


foreach($datasets as $dataset=>$themes){
    foreach($themes as $themeCode=>$theme){
        $dimCount = 0;
        $themeid = setThemeByName($apiid, $theme["theme"]);
        $sql = "update series set themeid=$themeid where apiid=$apiid and skey like '$dataset.$themeCode.%'";
        runQuery($sql);
        $dims = $theme["dimensions"];
        $dimensions = [];
        foreach($dims as $rank=>$dim){
            array_push($dimensions, $dim);
        }
        if(count($dimensions)==1){
            saveCube($theme["units"], $dimensions, []);
        }
        if(count($dimensions)==2){
            saveCube($theme["units"], [$dimensions[0]], [$dimensions[1]]);
            saveCube($theme["units"], [$dimensions[1]], [$dimensions[0]]);

            saveCube($theme["units"], $dimensions, []);
        }
        if(count($dimensions)>2){
            die("too many dims");
        }
    }
}

function saveCube($units, $varDims, $holdDims){
    global $apiid, $dataset, $themeCode, $themeName, $themeid;
    $filter  = ["%", "%", "%"];
    for($i=0;$i<count($holdDims);$i++){
        $rank = intval($holdDims[$i]["rank"]);
        $filter[$rank] = $holdDims[$i]["totalCode"];
    }
    $cube = setCubeByDimensions($themeid, $varDims, $units);
    $cubeid = $cube["id"];
    cubeSeries($cubeid, $filter, $varDims);
}

function cubeSeries($cubeid, $filter, $varDims, $pop=false){
    global $apiid, $db, $dataset, $themeCode, $themeName;
    $thisDim = [];
    if($pop) array_shift($varDims);
    //var_dump( $varDims[0]);die();
    for($i=0;$i<count($varDims[0]["list"]);$i++){
        $var = $varDims[0]["list"][$i];
        array_push($thisDim, ["name"=>$var["name"]]);
        $rank = intval($varDims[0]["rank"]);
        $filter[$rank] = $var["code"];
        if(count($varDims)==1){
            $sql = "insert ignore into cubeseries (cubeid, seriesid, geoid) (select $cubeid, seriesid, geoid from series where apiid=$apiid and skey like '$dataset.$themeCode.".implode("-", $filter).".%')";
            runQuery($sql);
            printNow($sql.": ". $db->affected_rows);
        } else {
            cubeSeries($cubeid, $filter, $varDims, true);
        }
    }
}

